window.addEventListener('load', Onload);

const loadImage = () => {
    return new Promise((resolve, reject) => {
        let src = 'data:image/png;base64,';
        let img = document.createElement('img');

        img.src = src;

        img.onload = () => {
            resolve(img);
        };

        img.onerror = () => {
            reject(img);
        };
    });
};

async function Onload(){
    let canvas = document.querySelector('#canvas1');
    let penColor = '#ff0000';
    let img = await loadImage();
    let paintBoard = new PaintBoard({
        canvas,
        enableHistory : true,
        historyMax : 5,
        logicalWidth : window.innerWidth,
        logicalHeight : window.innerHeight,
        strokeConfig : {
            strokeWidth : 10,
            strokeColor : penColor
        },
        background : {
            color : '#00ff00',
            image : img
        },
        clearColor : 'transparent'
    });

    paintBoard.Tool('pen');

    let lineWidth = document.querySelector('#line-width');
    let lineColor = document.querySelector('#line-color');
    let btnClean = document.querySelector('#btn-clean');
    let btnUndo = document.querySelector('#btn-undo');
    let btnRedo = document.querySelector('#btn-redo');
    let btnGetFile = document.querySelector('#btn-get-file');
    let btnGetAB = document.querySelector('#btn-get-array-buffer');
    let btnGetBase64 = document.querySelector('#btn-get-base64');
    let cbxBlend = document.querySelector('#cbx-blend');
    let outputImg = document.querySelector('#output-img');

    // console.log(lineWidth, lineColor);

    lineWidth.onchange = (e) => {
        paintBoard.strokeConfig.strokeWidth = Number(lineWidth.value);
    };

    lineColor.onclick = (e) => {
        ColorPicker.Open({
            x : e.x,
            y : e.y,
            color : penColor,
            close : 'backdrop',
            onClose : (value) => {
                let v = value.hexs ;

                penColor = v;
                lineColor.style.backgroundColor = v;
                paintBoard.strokeConfig.strokeColor = v;
            }
        });
    };

    btnClean.onclick = () => {
        paintBoard.Method('clear');
    };

    btnUndo.onclick = () => {
        paintBoard.Method('undo');
    };

    btnRedo.onclick = () => {
        paintBoard.Method('redo');
    };

    cbxBlend.onclick = () => {
        //
    };

    btnGetFile.onclick = () => {
        paintBoard.SaveData({
            returnType : 'file',
            compBg : cbxBlend.checked,
            cb:(file) =>{
                console.log(file);
            }
        });
    };

    btnGetAB.onclick = () => {
        let arraybuffer = paintBoard.SaveData({
            returnType : 'arraybuffer',
            compBg : cbxBlend.checked
        });

        console.log(arraybuffer);
    };

    btnGetBase64.onclick = () => {
        let base64 = paintBoard.SaveData({
            returnType : 'base64',
            compBg : cbxBlend.checked
        });

        outputImg.src = base64
        console.log(base64);
    };
}